theme.source:
@theme-name: t-heading-default;

.@{theme-name} {
  padding: 5px 10px;
  h2 {
  }

  h2, a {
    font-size: 18px;
  }

  a:hover {
  }
}

@theme-name: t-heading-01;

.@{theme-name} {
  background: #EFF1F0 url(bg.png) repeat-x;
  border: 1px solid #ddd;
  height: 38px;

  h2 {
    padding: 0 10px;
  }

  h2, a {
    font-size: 16px;
    color: #555;
  }

  a:hover {
    color: #555;
  }
}

@theme-name: t-heading-02;

