    padding: 5px 10px;
  }

  h2, a {
    font-size: 14px;
    color: #555;
  }

  a:hover {
    color: #555;
  }
}

@theme-name: t-heading-03;

.@{theme-name} {
  border-bottom: 1px solid #ddd;

  h2 {
    padding: 5px 10px 5px 20px;
    margin: 0 5px;
    background: url(greendot.gif) no-repeat left;
  }

  h2, a {
    font-size: 14px;
    color: #555;
  }

  a:hover {
    color: #555;
  }
}

@theme-name: t-heading-04;

.@{theme-name} {
  height: 30px;
  background: #383537;

  h2 {
    overflow: visible;
    position: relative;
    padding-left: 15px;
    height: 30px;
    line-height: 30px;
  }

  h2 i {
    display: block;
    position: absolute;
    top: 0;
    left: 0;
    height: 30px;
    width: 4px;
    background: #c4271a;
  }

  h2, a {
    font-size: 16px;
    color: #ffffff;
  }
}

