@theme-name: t-heading-09;

.@{theme-name} {
  background-color: #f1f2f2;
  height: 32px;
  margin: 5px 0;
  overflow: visible;

  h2 {
    background-color: #e93a39;
    height: 42px;
    line-height: 42px;
    padding: 0 10px;
    margin-top: -5px;
    overflow: visible;
    position: relative;

    i {
      display: block;
      position: absolute;
      right: -10px;
      top: 0;
      height: 42px;
      width: 10px;
      background: url(rededge.gif) no-repeat;
    }
  }

  h2, a {
    font-size: 16px;
    color: white;
  }

  a:hover {
